import React from "react";

function Setlist({ children }) {
    return (

        <li key={setlist._id}>
            <strong>
                Name: {setlist.name} Gig Type: {setlist.gigtype}
            </strong>
            className="list-group-item">

        </li>
    )
}

export default Setlist;
